message:
🇰🇷🔥👀COREIA DO SUL;

Lá, um túnel ao longo da rodovia pegou fogo. Como resultado de um incêndio em Gwacheon, 5 pessoas morreram e outras 29 ficaram feridas. O fogo começou após uma colisão entre um ônibus e um caminhão e rapidamente se espalhou em chamas e fumaça por todo o túnel.

